import React, { useState, useEffect } from "react";
import getData from "./axios";

const Getdata = () => {
  useEffect(() => {
    (async () => {
      try {
        // const url = "https://picsum.photos/1200/900";
        const url = "http://localhost:4040/post";
        let data = new FormData();
        data.append("name", "zhengfen");
        data.append("age", 23);
        let s = await getData(url, "post", null, data);
        console.log(s);
      } catch (err) {
        console.log(err);
      }
    })();
  }, []);
  return (
    <div>
      <h1> hello word</h1>
    </div>
  );
};

export default Getdata;
